    <section id=""features"" class=""features pb-0 m-0"">
        <div class=""container"">
            <h1>Mazda CX-5 2021, Mucho más para Experimentar</h1><p>La SUV Mazda CX-5 con todos sus galardones y virtudes en su modelo 2021 trae mejoras inigualables en su equipamiento, con tecnología única en su clase para vivir la experiencia de su refinado diseño enfocado en las personas.</p><p>Mazda CX-5 2021 llega con cuatro versiones Touring 2L, Grand Touring 2.5L, Grand Touring LX 2.5L y el lujoso y potente Grand Touring Signature 2.5L con Turbo de presión dinámica. Todos con motores Skyactive-G y caja automática de 6 velocidades.</p><p>Todo es armonía y confort en el Mazda CX-5 2021. Pantalla TFT de 8”, Sistema de info-entretenimiento Mazda Connect dotado con Botón Multicomando en la consola central para facilitar su operación e integrado con Andro");
            WriteLiteral(@"id y IPhone, mayor aislamiento acústico y control de cambios en el volante, además de sus asientos especialmente diseñados para reducir fatiga y favorecer la postura, conforman un entorno envolvente para todos los ocupantes.</p><p>Este ambiente que circunda el Mazda CX-5 2021 lo complementa el paquete de asistencias i-Activsense con modernos sensores para apoyar al conductor, cuyos controles e instrumentos están localizados estratégicamente para facilitar su operación y lectura. El paquete incluye:</p><p>•	Mitigación de Vuelco (ROM)</p><p>•	Reducción Colisión Secundaria (SCR).</p><p>•	Sistema Inteligente de iluminación frontal a través del cual se activan o desactivan las luces LED dependiendo de la luz de los vehículos en la vía.</p><p>•	Asistente de permanencia en carril (LKA-LAS)</p><p>•	Asistencia inteligente de frenado en ciudad delantero y trasero (SCBS) que advierte al conductor cuando la distancia con el vehículo adelante puede ser riesgosa y en caso que el conductor no reaccione ante la señal de avis");
            WriteLiteral(@"o acciona automáticamente los frenos, incluso a velocidades entre 10 y 80 km/h el sistema detecta peatones.  El frenado trasero actúa en operaciones de parqueo y reversa.</p><p>•	Alerta de Atención del Conductor (DAA) con base en el comportamiento habitual del conductor puede detectar estados de fatiga o disminución de atención y emite advertencia visual y sonora</p><p>•	Sistema avanzado de monitoreo de punto ciego (BSM)</p><p>•	Monitor vista 360° que proyecta en la pantalla táctil una visión del vehículo en todas las direcciones.</p><p>•	Señal de parada de emergencia (ESS)</p><p>•	Asistencia de arranque en pendiente (HLA)</p><p>Los Mazda CX-5 2021 equipados con i-Activ AWD se les ha adicionado la función “Off road” la cual permite un mejor comportamiento al arrancar en terrenos resbaladizos o situaciones con poco contacto de alguna de las ruedas con el suelo.</p><p>Las versiones Mazda CX-5 2021 Grand Touring, Grand Tourin LX y SIgnature traen los novedosos espejos retrovisores con desempañador.</p>
        ");
